const SettingOptions = [
    { id: 1, src: "fa fa-user", title: "ACCOUNT DETAILS", route:"/account-details" },
    { id: 2, src: "fa fa-lock", title: "SECURITY", route:"/security" },
    { id: 3, src: "fa fa-building", title: "BUSINESS INFORMATION", route:"/business-information" },
    { id: 4, src: "fa fa-file", title: "BILLING", route:"/billing" },
    { id: 5, src: "fa fa-file", title: "PLAN DETAILS", route:"/authorization" },
    { id: 5, src: "fa fa-bell", title: "NOTIFICATIONS", route:"/notifications" },
    { id: 5, src: "fa fa-key", title: "AUTHORIZATION", route:"/plan-details" }
  ];

  export default SettingOptions;
